import React from 'react';
import { Link } from 'react-router-dom';

const StudentHomePage = () => {
  const containerStyle = {
    fontFamily: 'Arial, sans-serif',
    padding: '20px',
  };

  const headerStyle = {
    color: '#4CAF50',
  };

  const navStyle = {
    margin: '20px 0',
  };

  const navListStyle = {
    listStyleType: 'none',
    padding: 0,
  };

  const navItemStyle = {
    margin: '10px 0',
  };

  const linkStyle = {
    textDecoration: 'none',
    color: '#007BFF',
    fontWeight: 'bold',
  };

  const footerStyle = {
    marginTop: '20px',
    textAlign: 'center',
    color: '#777',
  };

  return (
    <div style={containerStyle}>
      <header style={headerStyle}>
        <h1>Welcome, Student!</h1>
      </header>

      <div style={navStyle}>
        <ul style={navListStyle}>
          <li style={navItemStyle}>
            <Link to="/profile" style={linkStyle}>Profile</Link>
          </li>
          <li style={navItemStyle}>
            <Link to="/courses" style={linkStyle}>Courses</Link>
          </li>
          <li style={navItemStyle}>
            <Link to="/assignments" style={linkStyle}>Assignments</Link>
          </li>
          <li style={navItemStyle}>
            <Link to="/grades" style={linkStyle}>Grades</Link>
          </li>
          <li style={navItemStyle}>
            <Link to="/logout" style={linkStyle}>Logout</Link>
          </li>
        </ul>
      </div>

      <section>
        <h2>Quick Links</h2>
        <p>Use the links above to navigate to various sections of your student portal.</p>
      </section>

      <footer style={footerStyle}>
        <p>&copy; 2024 Student Portal</p>
      </footer>
    </div>
  );
};

export default StudentHomePage;
